import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function SignUp() {
  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('student');
  const [passwordError, setPasswordError] = useState('');

  const handleRegister = () => {
    // Check if any of the required fields are empty
    if (!fullName || !email || !password || !role) {
      setFormError('Please fill in all required fields.');
    } else {
      // Password validation
      const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@#$%^&!*_])[A-Za-z\d@#$%^&!*_]{8,}$/;

      if (!password.match(passwordRegex)) {
        alert('Password must contain at least 8 characters, including one uppercase letter, one lowercase letter, one number, and one special character.');
      } else {
        // Perform registration logic here, e.g., validate input and create a new user account.
        // You can replace the following alert with your actual registration logic.
        alert('Registration successful!'); 
      }
    }
  };

  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/index">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/help">Contact Us</Link>
        <Link to="/service">Services</Link>
        <Link to="/login">Login</Link>
      </nav>
      <div className="container">
        <div className="content">
          <div className="text">
            <center>
              <h2>Sign Up</h2>
            </center>
            <div className="login-box">
              <div className="box-heading">Full Name:</div>
              <input type="text" className="box-input" placeholder="Enter your full name" value={fullName} onChange={(e) => setFullName(e.target.value)} />
              <div className="box-heading">Email:</div>
              <input type="email" className="box-input" placeholder="Enter your email" value={email} onChange={(e) => setEmail(e.target.value)} />
              <div className="box-heading">Password:</div>
              <input type="password" className="box-input" placeholder="Enter your password" value={password} onChange={(e) => setPassword(e.target.value)} />
              {passwordError && <div className="error-message">{passwordError}</div>}
              <div className="box-heading">Role:</div>
              <select className="box-input" value={role} onChange={(e) => setRole(e.target.value)}>
                <option value="student">Student</option>
                <option value="instructor">Instructor</option>
                <option value="admin">Administrator</option>
                <option value="progcord">Program Coordinator</option>
                <option value="qaofficer">QA Officer</option>
              </select>
              <div className="box-button">
                <button onClick={handleRegister}>Register</button>
              </div>
            </div>
          </div>
        </div>
      </div>
      <footer>
        <p>&copy; Copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
}

export default SignUp;
